    {
        title: "Career",
        icon: <HomeIcon />,
        link: "Smooth scroll"
    },
    {
        title: "Education",
        icon: <HomeIcon />,
        link: "Smooth scroll"
    },
    {
        title: "Download CV",
        icon: <HomeIcon />,
        link: "Smooth scroll"
    },



]
